import {
  AsideLogo,
  AsideMenuItem,
  DashboardAside,
  LogoText,
  Menu,
} from '../../styles/common/aside.styles';
import DashboardOutlinedIcon from '@mui/icons-material/DashboardOutlined';
import AssignmentIndOutlinedIcon from '@mui/icons-material/AssignmentIndOutlined';
import TopicOutlinedIcon from '@mui/icons-material/TopicOutlined';
import ChecklistOutlinedIcon from '@mui/icons-material/ChecklistOutlined';
import KeyboardArrowRightOutlinedIcon from '@mui/icons-material/KeyboardArrowRightOutlined';
import KeyboardArrowDownOutlinedIcon from '@mui/icons-material/KeyboardArrowDownOutlined';
import { useNavigate } from 'react-router-dom';

const DashboardSidebar = (props) => {
  let target = false;
  let items = [
  {icon : <DashboardOutlinedIcon />, title:'Overview', path:'/overview' }, 
  {icon : <AssignmentIndOutlinedIcon />, title:'경력' , path:'/career'},
  {icon : <TopicOutlinedIcon />, title:'활동게시판' , path:'/activity'},
  {icon : <ChecklistOutlinedIcon />, title:'할일 목록' ,path:'/todo'}];

    const navigate = useNavigate();


  return (
    <DashboardAside>
      <AsideLogo>
        <img src={'/logo.png'} alt="logo" />
        <LogoText>Portfolio For</LogoText>
      </AsideLogo>
      <nav>
        <Menu>
          {items.map((el)=><li key={el.title} onClick={()=>{navigate(el.path)}}>
            <AsideMenuItem acti>
              {el.icon}
              <p>{el.title}</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>)}
          <li>
            <AsideMenuItem>
              <AssignmentIndOutlinedIcon />
              <p>경력</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>
          <li>
            <AsideMenuItem>
              <TopicOutlinedIcon />
              <p>활동 게시판</p>
              <KeyboardArrowDownOutlinedIcon />
            </AsideMenuItem>
          </li>
          <li>
            <AsideMenuItem>
              <ChecklistOutlinedIcon />
              <p>할일 목록</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>
        </Menu>
      </nav>
    </DashboardAside>
  );
};

export default DashboardSidebar;
